import React from "react";
import SearchBar from "./SearchBar";
import { NavLink } from "react-router-dom";


const Nav = ({ onSearch}) => {
    return(
        <nav>
            <SearchBar onSearch={onSearch} Error/>
            <button>
                <NavLink to='/About' >About</NavLink>
            </button>
            
            <button> 
                <NavLink to='/' >Home</NavLink>
            </button>
            <hr />
        </nav>
        
    )
}

export default Nav;
